  space: '6e53lvm4k39v',
  accessToken: 'jzJGPKMlzj3lJVzxIdJmtingDhn9foWMOpL_afOZxjk'
})


export default function Layout(props) {
    useEffect(() => {
            const entries = client.getEntries({ content_type: 'person' })
            console.log(entries);
    }, [])
    return (
        <div className="container">
            <Header />
            {props.children}
            <Footer />
        </div>
    )
}
